  importClass(Packages.java.util.ArrayList);
importPackage(Packages.com.reader.comic.model);
importClass(Packages.okhttp3.Headers);
importClass(Packages.okhttp3.Request);
importClass(Packages.okhttp3.RequestBody);
importClass(Packages.okhttp3.OkHttpClient);
function parseChapter() {
    var list = new ArrayList();
    var client = new OkHttpClient();
    var comic = JSON.parse(content);
    var comic_id = comic.data.comic_id;
    var request = new Request.Builder().url("https://comic.mkzhan.com/chapter/?comic_id="+comic_id).build();
    var response = client.newCall(request).execute();
    if (response.isSuccessful()) {
        var chapterList = JSON.parse(response.body().string());
        for (var i = chapterList.data.length-1; i >=0; i--) {
            var chapter = chapterList.data[i];
            var title = chapter.title;
            var path = comic_id+"/"+chapter.chapter_id;
            list.add(new Chapter(title, path))
        }
    }
    return list
};
